// import logo1 from "./img/lusd.png";
// import logo2 from "./img/Dai_Logo 1.png";
import React from "react";

import { Button, Row,Col } from "react-bootstrap";
import {Link} from "react-router-dom";

import './card.css';

function auctionCard() {
  return (
    <div className="container auction-card-container">
      <div className="auction-card-wrapper">
        <div className="module">
          <Row>
                      <Col>
                      </Col>
            <Col></Col>
          </Row>
          <Button className="hb-btn-custom" variant="primary">
            <Link className="four04-btn" to="/home">
              Submit
            </Link>
          </Button>
        </div>
      </div>
    </div>
  );
};
export default auctionCard;
